Problem 2- Remarks on Code Implementatio:
Code is mostly correct but failed few test cases class Solution {
public:
    int maximumSum(vector<int>& arr) {
        if(arr.size()==0)  return 0;
        if(arr.size()==1)  return arr[0];
        int maxans=arr[0];
        int skip=1;
        int skipindex=0;
        int j=0;
        int  sum=0;
        int maxnumber=INT_MIN;
        for(int i=0;i<arr.size();i++){
            if(sum+arr[i]<0){
                if(skip==1){
                    skipindex=i;
                    skip--;
                    continue;
                }
                else{
                    while(j<skipindex  && j<=arr.size()){
                         sum-=arr[j];
                        j++;
                        skip=1;
                    }
                    j++;
                }
            }
            else
             sum+=arr[i];
            maxnumber=max(maxnumber,arr[i]);
            maxans=max(maxans,max(sum,arr[i]));
            // cout<<"maxans "<<maxans<<" at index = "<<i<<" sum "<<sum<<endl;
        }
        if(maxnumber>0)
          return maxans;
        else return  maxnumber;
    }
};
